-- ----------------------------
-- Procedure structure for `deleteOldPoint`
-- ----------------------------
DROP PROCEDURE IF EXISTS `deleteOldPoint`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `deleteOldPoint`(IN `studentId` bigint,IN `subjectId` bigint,IN `sem` tinyint,IN`numOfTest` tinyint)
BEGIN
	DELETE p from tblPoint as p 
	WHERE p.student_id = studentId AND p.subject_id = subjectId AND p.sem = sem AND p.num_of_test = numOfTest;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `findNotifyByStatus`
-- ----------------------------
DROP PROCEDURE IF EXISTS `findNotifyByStatus`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `findNotifyByStatus`(IN `userId` bigint,IN `status` bit)
BEGIN
	select *
	from tblNotifyDevice nd
	WHERE nd.is_read = status and nd.user_id = userId
	GROUP BY nd.notify_id;
END
;;
DELIMITER ;

