-- ----------------------------
-- Procedure structure for `getConversionByUserName`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getConversionByUserName`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `getConversionByUserName`(IN userName varchar(250))
SELECT *, COUNT(*) AS total_message FROM (
	SELECT m.*, u.full_name, u.avatar from tblMessage m
		LEFT JOIN tblUser u ON m.send_from = u.user_name
		WHERE send_to = userName
		UNION
		SELECT m.*, u.full_name, u.avatar from tblMessage m
		LEFT JOIN tblUser u ON m.send_to = u.user_name
		WHERE send_from = userName
) as mess
GROUP BY mess.send_from, mess.send_to
ORDER BY mess.created_date DESC
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getDeviceByClassIds`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getDeviceByClassIds`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `getDeviceByClassIds`(
	IN classIds VARCHAR(250)
)
BEGIN
	SELECT ud.* FROM tblUserDevice ud
    JOIN tblStudent s on s.parent_id = ud.user_id 
    WHERE FIND_IN_SET(s.class_id, classIds);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getListPoint`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getListPoint`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `getListPoint`(IN `studentIds` varchar(250),IN `subjectId` bigint,IN `sem` tinyint,IN `numOfTest` tinyint)
BEGIN
	SELECT *, 
	GROUP_CONCAT(CASE WHEN p.multiple = '1' THEN p.point ELSE "" END SEPARATOR ' ') as multiple1,
	GROUP_CONCAT(CASE WHEN p.multiple = '2' THEN p.point ELSE "" END SEPARATOR ' ') as multiple2,
	GROUP_CONCAT(CASE WHEN p.multiple = '3' THEN p.point ELSE "" END SEPARATOR ' ') as multiple3
	from tblPoint p
	WHERE FIND_IN_SET(p.student_id, studentIds) AND p.subject_id = subjectId AND p.sem = sem AND p.num_of_test = numOfTest
	GROUP BY p.student_id;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getMessage`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getMessage`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `getMessage`(IN `fromUser` varchar(50),
IN `toUser` varchar(50),
IN `size` int,
IN `startFrom` bigint)
BEGIN
	SELECT m.*, u.full_name, u.avatar from tblMessage m
	JOIN tblUser u ON m.send_from_id = u.id
	WHERE (send_to = toUser AND send_from = fromUser) OR (send_to = fromUser AND send_from = toUser)
	ORDER BY created_date DESC
	LIMIT startFrom, size;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getStudentByClassIds`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getStudentByClassIds`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `getStudentByClassIds`(
	IN classIds VARCHAR(100)
)
BEGIN
	SELECT s.*, c.name as class_name, u.full_name FROM tblStudent s
    JOIN tblClass c on s.class_id = c.id 
    JOIN tblUser u on u.id = s.parent_id 
    WHERE FIND_IN_SET(s.class_id, classIds);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `updateStatusRead`
-- ----------------------------
DROP PROCEDURE IF EXISTS `updateStatusRead`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `updateStatusRead`(IN notifyIds VARCHAR(250),
	IN userId BIGINT)
    DETERMINISTIC
BEGIN

	IF notifyIds = '' THEN
		 UPDATE tblNotifyDevice nd SET nd.is_read = 1 WHERE nd.user_id = userId;
	ELSE
			UPDATE tblNotifyDevice nd
			SET nd.is_read = 1
			WHERE FIND_IN_SET(nd.notify_id, notifyIds) AND nd.user_id = userId;
	END IF;

END
;;
DELIMITER ;
